import { useLocation, useParams } from 'react-router-dom';
const User =()=>{
const location=useLocation()
const {name} =useParams()
    return(
        <>
            <h1>i am from {location.pathname} page</h1>
            {location.pathname===`/User/mobashir`? (
            <button onClick={()=>alert='wow'}>click me</button> ) : null}
        </>
    )

}
export default User
